import React from "react";
import Typewriter from "typewriter-effect";

const LandingPage = () => (
  <div className="not-fancy-font text-white mt-20 responsive-text">
    <Typewriter
      onInit={(typewriter) => {
        typewriter
          .typeString(
            // "Hi! I'm Nika, a software engineer and an artist located in Dallas. let's create, collaborate, and connect!  "
            <div>Hi! I'm Nika, a software engineer and an artist located in Dallas. let's create, collaborate, and connect!  </div>

          )
          .pauseFor(2500)
          .start();
      }}
    />
  </div>
);

export default LandingPage;
